class FloatingParticle {
    constructor(effect) {
        this.effect = effect;
        this.x = Math.random() * this.effect.canvasWidth;
        this.y = Math.random() * this.effect.canvasHeight;
        this.size = Math.random() * 2 + 0.5;
        this.speedX = (Math.random() * 1) - 0.5;
        this.speedY = (Math.random() * 1) - 0.5;
        this.color = 'rgb(135, 206, 250)';
    }
    draw(ctx) {
        ctx.fillStyle = this.color;
        ctx.beginPath();
        ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        ctx.closePath();
        ctx.fill();
    }
    update() {
        this.x += this.speedX;
        this.y += this.speedY;

        if (this.x < 0) this.x = this.effect.canvasWidth;
        if (this.x > this.effect.canvasWidth) this.x = 0;
        if (this.y < 0) this.y = this.effect.canvasHeight;
        if (this.y > this.effect.canvasHeight) this.y = 0;
    }
}

class Particle {
    constructor(effect, x, y, color) {
        this.effect = effect;
        this.targetX = x;
        this.targetY = y;
        this.x = Math.random() * effect.canvasWidth;
        this.y = Math.random() * effect.canvasHeight;
        this.vx = 0;
        this.vy = 0;
        this.ease = Math.random() * 0.10 + 0.008; // Slower, randomized easing for "slow gathering" effect
        // Smaller particles on mobile for better shape definition
        this.size = effect.isMobile ? 1.0 : 1.5;
        this.color = color;
        this.jitterX = (Math.random() - 0.5) * 2;
        this.jitterY = (Math.random() - 0.5) * 2;
        // this.speedFactor = Math.random() * 30 + 40;

    }

    update() {
        const dx = (this.targetX + this.jitterX) - this.x;
        const dy = (this.targetY + this.jitterY) - this.y;
        this.x += dx * this.ease;
        this.y += dy * this.ease;
    }

    draw(ctx) {
        ctx.fillStyle = this.color;
        if (this.color === '#59b7ff' || this.color.startsWith('rgb(89, 183, 255)')) {
            ctx.shadowBlur = 5;
            ctx.shadowColor = this.color;
        } else {
            ctx.shadowBlur = 0;
        }

        ctx.beginPath();
        ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        ctx.fill();
        ctx.shadowBlur = 0;
    }
}

class Effect {
    constructor(canvasWidth, canvasHeight, pngImage) {
        this.canvasWidth = canvasWidth;
        this.canvasHeight = canvasHeight;
        this.textX = this.canvasWidth / 2;
        this.textY = this.canvasHeight / 2;
        
        // Mobile detection and responsive settings
        this.isMobile = canvasWidth < 768;
        this.isTablet = canvasWidth >= 768 && canvasWidth < 1024;
        
        // Responsive font size
        if (this.isMobile) {
            this.fontSize = 70;
            this.gap = 2; // Smaller gap for more particles and better shape definition on mobile
        } else if (this.isTablet) {
            this.fontSize = 100;
            this.gap = 3;
        } else {
            this.fontSize = 150;
            this.gap = 3; // Desktop - unchanged
        }
        
        this.particles = [];
        this.backgroundParticles = [];
        this.mouse = {
            radius: 5000,
            x: 0,
            y: 0
        }
        this.png = pngImage;
        this.initBackgroundParticles();
    }

    initBackgroundParticles() {
        this.backgroundParticles = [];
        // Reduce particles on mobile/tablet for better performance
        let numberOfBackgroundParticles;
        if (this.isMobile) {
            numberOfBackgroundParticles = 400; // Reduced for mobile
        } else if (this.isTablet) {
            numberOfBackgroundParticles = 600; // Reduced for tablet
        } else {
            numberOfBackgroundParticles = 1000; // Full count for desktop
        }
        
        for (let i = 0; i < numberOfBackgroundParticles; i++) {
            this.backgroundParticles.push(new FloatingParticle(this));
        }
    }

    // Function to draw image and text, then convert to particles
    drawImage(ctx) {
        // Clear canvas for fresh drawing
        ctx.clearRect(0, 0, this.canvasWidth, this.canvasHeight);

        // 1. Draw Text (Left side) with responsive font size
        ctx.fillStyle = '#59b7ff';
        ctx.font = `bold ${this.fontSize}px "Roboto Condensed", sans-serif`;
        ctx.textAlign = 'center';
        ctx.textBaseline = 'middle';

        // Text and logo side-by-side layout (same as desktop on all devices)
        const textAnchorX = this.canvasWidth * 0.50; // Text on right side (same as desktop)
        ctx.fillText('ToolFolioHub', textAnchorX, this.textY);

        // 2. Draw Logo (Left side) using the png image with responsive sizing
        if (this.png && this.png.complete && this.png.naturalHeight !== 0) {
            let logoHeight;
            let logoX, logoY;
            
            if (this.isMobile) {
                logoHeight = 200; // Smaller logo on mobile but still side-by-side
                logoX = this.canvasWidth * 0.30; // Left side (same as desktop)
                logoY = this.textY - (logoHeight / 30); // Same vertical alignment as desktop
            } else if (this.isTablet) {
                logoHeight = 200; // Medium logo on tablet
                logoX = this.canvasWidth * 0.12;
                logoY = this.textY - (logoHeight / 1.7);
            } else {
                logoHeight = 300; // Full size on desktop (unchanged)
                logoX = this.canvasWidth * 0.12;
                logoY = this.textY - (logoHeight / 1.7);
            }
            
            const scale = logoHeight / this.png.height;
            const logoWidth = this.png.width * scale;

            ctx.drawImage(this.png, logoX, logoY, logoWidth, logoHeight);
        }

        // 3. Convert to particles
        this.getImageData(ctx);
    }

    getImageData(ctx) {
        this.particles = [];
        const pixels = ctx.getImageData(0, 0, this.canvasWidth, this.canvasHeight).data;
        ctx.clearRect(0, 0, this.canvasWidth, this.canvasHeight);

        // On mobile, skip fewer particles for better shape definition
        const skipThreshold = this.isMobile ? 0.7 : 0.8;

        for (let y = 0; y < this.canvasHeight; y += this.gap) {
            for (let x = 0; x < this.canvasWidth; x += this.gap) {
                const index = (y * this.canvasWidth + x) * 4;
                const alpha = pixels[index + 3];

                if (alpha > 0) {
                    if (Math.random() > skipThreshold) continue;

                    const red = pixels[index];
                    const green = pixels[index + 1];
                    const blue = pixels[index + 2];
                    const color = `rgb(${red}, ${green}, ${blue})`;

                    this.drawParticle(x, y, color);
                }
            }
        }
    }

    drawParticle(x, y, color) {
        this.particles.push(new Particle(this, x, y, color));
    }

    render(ctx) {
        this.backgroundParticles.forEach(particle => {
            particle.update();
            particle.draw(ctx);
        });

        this.particles.forEach(particle => {
            particle.update();
            particle.draw(ctx);
        });
    }

    resize(width, height) {
        this.canvasWidth = width;
        this.canvasHeight = height;
        this.textX = this.canvasWidth / 2;
        this.textY = this.canvasHeight / 2;
        
        // Recalculate responsive settings on resize
        this.isMobile = width < 768;
        this.isTablet = width >= 768 && width < 1024;
        
        // Update font size and gap on resize
        if (this.isMobile) {
            this.fontSize = 70;
            this.gap = 2; // Smaller gap for more particles on mobile
        } else if (this.isTablet) {
            this.fontSize = 100;
            this.gap = 3;
        } else {
            this.fontSize = 150;
            this.gap = 3; // Desktop - unchanged
        }
        
        this.initBackgroundParticles();
    }
}

document.addEventListener('DOMContentLoaded', () => {
    const canvas = document.getElementById('text-canvas');
    const container = document.getElementById('particle-header-container');
    const ctx = canvas.getContext('2d', { willReadFrequently: true });

    function setSize() {
        if (container) {
            canvas.width = container.clientWidth;
            canvas.height = container.clientHeight;
        }
    }

    setSize();

    // --- USER REQUESTED STRUCTURE START ---
    var png = new Image();

    // PASTE BASE64 HERE - Replace the src below with your base64 string
    // png.src = "data:image/png;base64,..."; 
    png.src = 'data:image/png;base64,'
    // --- USER REQUESTED STRUCTURE END ---

    let effect;

    function init() {
        setSize();
        if (!effect) {
            effect = new Effect(canvas.width, canvas.height, png);
        } else {
            effect.resize(canvas.width, canvas.height);
        }
        effect.drawImage(ctx);
    }

    // Initialize once font is ready AND image is loaded
    Promise.all([
        document.fonts.ready,
        new Promise((resolve) => {
            if (png.complete && png.naturalHeight !== 0) {
                resolve();
            } else {
                png.onload = resolve;
                png.onerror = () => {
                    console.error("Failed to load logo image");
                    resolve();
                };
            }
        })
    ]).then(() => {
        init();
    });

    // Fallback
    png.onload = () => {
        setTimeout(() => {
            if (!effect) init();
        }, 500);
    };

    function animate() {
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        if (effect) effect.render(ctx);
        requestAnimationFrame(animate);
    }
    animate();

    window.addEventListener('resize', () => {
        init();
    });
});
